import logo from "../images/logo.svg"
const Footer = () => {
    return ( 
        <div className="footer">
            <div className="logopic">
            <center><img src={logo} alt="" /></center>
            </div>
            <div className="links">
            <a href="">Terms and condition</a>
            <a href=""> Send us Feedback</a>
            <a href="">Help</a>
            </div>
        </div>

     );
}

export default Footer;
